message:
*ATENÇÃO* 🚨

 *11 DIAS EM FRENTE OS QUARTÉIS JÁ CONSEGUIMOS O SEGUINTE:* 

1 Criar uma ruptura na hierarquia da PRF. PF, polícia Militar e guarda Municipal. Exército, Marinha e Aeronáutica. Toda a base das forças estão falando disso. Estão com o Povo e não vão aceitar ordem de Criminosos sentados no poder;

2 - Expor toda a fraude das urnas;

3 - Toda a Mídia internacional cobrindo a fraude no Brasil;

4 - Senadores e Deputados já reconhecem na câmara que não vivíamos em um estado de Direto e que a população está consciente disso;

5 - Partidos como PL já declaram não reconhecer eleição presidencial;

6 - Republicanos vencendo nos EUA. Vão apoiar nossa solicitação;

7 - Relatório do Exército apontam risco de violação e manipulação das urnas. Falhas na segurança e solicitam abertura de comissão de investigação com Urgencia. Obs: Enquanto, estiver aberta a Comissão de investigação o processo fica suspenso; 

8 – Bolsonaro Nomeia André Tavares como novo Ministro do STE;

9 – Muitos advogados internacionais vão apresentar relatório sobre a censura absurda que está ocorrendo no Brasil à Corte de Direitos Humano terça feira dia 15/11 nos EUA;

10 - TsE não apresentou data para diplomação;

11 – Concentração nos quartéis vai aumentar muito na sexta, sábado e domingo;

12 – Mega Manifestação/Concentração dia  15 de Novembro, data da Proclamação da República do Brasil;

Parece pouco para 11 dias? 

 *VAMOS MANTER NOSSA POSIÇÃO EM FRENTE AOS QUARTÉIS* 

SOS FORÇAS ARMADAS
LIMPEZA GERAL 🇧🇷 

Em 1964 durou 12 dias para o exército agir contra os comunistas

 *COMPARTILHEM*
